# syscall constants
PRINT_STRING		= 4
PRINT_CHAR		= 11
PRINT_INT		= 1

# memory-mapped I/O
VELOCITY		= 0xffff0010
ANGLE			= 0xffff0014
ANGLE_CONTROL		= 0xffff0018

BOT_X			= 0xffff0020
BOT_Y			= 0xffff0024
GET_OPPONENT_HINT	= 0xffff00ec

TIMER			= 0xffff001c
ARENA_MAP		= 0xffff00dc

SHOOT_UDP_PACKET	= 0xffff00e0
GET_BYTECOINS		= 0xffff00e4
USE_SCANNER		= 0xffff00e8

REQUEST_PUZZLE		= 0xffff00d0  ## Puzzle
SUBMIT_SOLUTION		= 0xffff00d4  ## Puzzle

BONK_INT_MASK		= 0x1000
BONK_ACK		= 0xffff0060

TIMER_INT_MASK		= 0x8000
TIMER_ACK		= 0xffff006c

REQUEST_PUZZLE_INT_MASK = 0x800       ## Puzzle
REQUEST_PUZZLE_ACK	= 0xffff00d8  ## Puzzle

RESPAWN_INT_MASK	= 0x2000      ## Respawn
RESPAWN_ACK		= 0xffff00f0  ## Respawn

# our constants
DEBUG = 0

.data

# Instruction memory is at bottom of file
# Respawn pointers are at bottom of file
# Auto-generated by gen_inst.py <inst.txt> -r spimbot.s

current_move: .word 0

### Puzzle
puzzle:     .byte 0:268
solution:   .byte 0:256
has_puzzle: .word 0

### Arena Map Check
fire_udp_rounds: .word 0

### Arena Map
arena_map: .byte 0:1600

### Other
is_blue_bot: .word 0

#############
# Main code #
#############
.text
main:
	# Construct interrupt mask
	li	$t4, 0
	or	$t4, $t4, REQUEST_PUZZLE_INT_MASK	# puzzle interrupt bit
	or	$t4, $t4, RESPAWN_INT_MASK		# respawn interrupt bit
	or	$t4, $t4, TIMER_INT_MASK		# timer interrupt bit
	or	$t4, $t4, 1				# global enable
	mtc0	$t4, $12

	# Setup code
	lw	$t0, BOT_X				# Identify if red or blue bot via starting location
	sgt	$t1, $t0, 160				# true if starting on the right half of the map
	sw	$t1, is_blue_bot			# Important for orientation of angle and movement

	li	$t0, 1000				# Kick off kernel instruction loop after
	sw	$t0, TIMER				# 1000 cycles

	# Puzzle solving
	la	$s0, puzzle				# Puzzle address

request_puzzle:
	sw	$s0, REQUEST_PUZZLE			# Request puzzle

check_puzzle_available:
	lw	$t0, has_puzzle				# Kernel writes to has_puzzle when puzzle is available
	beq	$t0, $zero, check_puzzle_available	# has_puzzle used to communicate between kernel and user

	la	$a0, puzzle				# Load solver arguments
	la	$a1, solution
	li	$a2, 0
	li	$a3, 0

	jal	solve					# Call solver

	la	$t0, solution				# Submit solution
	sw	$t0, SUBMIT_SOLUTION

	sw	$zero, has_puzzle			# Reset has_puzzle

	j	request_puzzle				# User-space code requests and solves puzzles forever
							# (Kernel code does the moving)
	jr	$ra

###############
# Kernel code #
###############
.kdata
chunkIH:    .space 60
non_intrpt_str:    .asciiz "Non-interrupt exception\n"
unhandled_str:	  .asciiz "Unhandled interrupt type\n"
.ktext 0x80000180
interrupt_handler:
.set noat
	move	$k1, $at			# Save $at
						# NOTE: Don't touch $k1 or else you destroy $at!
.set at
	la	$k0, chunkIH
	sw	$a0, 0($k0)			# Get some free registers
	sw	$v0, 4($k0)			# by storing them to a global variable
	sw	$t0, 8($k0)
	sw	$t1, 12($k0)
	sw	$t2, 16($k0)
	sw	$t3, 20($k0)
	sw	$t4, 24($k0)
	sw	$t5, 28($k0)
	sw	$t6, 32($k0)
	sw	$t7, 36($k0)
	sw	$t8, 40($k0)
	sw	$t9, 44($k0)

	# Save coprocessor1 registers!
	# If you don't do this and you decide to use division or multiplication
	#   in your main code, and interrupt handler code, you get WEIRD bugs.
	mfhi	$t0
	sw	$t0, 48($k0)
	mflo	$t0
	sw	$t0, 52($k0)

	mfc0	$k0, $13			# Get Cause register
	srl	$a0, $k0, 2
	and	$a0, $a0, 0xf			# ExcCode field
	bne	$a0, 0, non_intrpt

interrupt_dispatch:				# Interrupt:
	mfc0	$k0, $13			# Get Cause register, again
	beq	$k0, 0, done			# handled all outstanding interrupts

	and	$a0, $k0, TIMER_INT_MASK	# is there a timer interrupt?
	bne	$a0, 0, timer_interrupt

	and	$a0, $k0, REQUEST_PUZZLE_INT_MASK
	bne	$a0, 0, request_puzzle_interrupt

	and	$a0, $k0, RESPAWN_INT_MASK
	bne	$a0, 0, respawn_interrupt

	and	$a0, $k0, BONK_INT_MASK		# is there a bonk interrupt?
	bne	$a0, 0, bonk_interrupt		# Bonk interrupt currently unused

	li	$v0, PRINT_STRING		# Unhandled interrupt types
	la	$a0, unhandled_str
	syscall
	j	done

bonk_interrupt:
	sw	$0, BONK_ACK
	j	interrupt_dispatch		# see if other interrupts are waiting

### Movement Pattern
# -360 to 360		absolute angle
# 1500 +- v		velocity
# 2000			UDP, may be contingent on previous check of arena map
# 3000 + (x << 6) + y	Check arena map at x, y and set flag for next UDP
# 10000000 + cm		Set current_move to cm
# 20000000		End program
# 100000000 + c		Delay c cycles

timer_interrupt:
	sw	$zero, TIMER_ACK

	lw	$t0, current_move		# load instruction counter

# INSTRUCTION
execute_until_delay:				# main instruction loop that hands control back to user when delaying
	lw	$t1, movement($t0)		# load instruction

	add	$t0, $t0, 4			# increment instruction counter

	#li	$t9, DEBUG			# DEBUG on prints out current x, y on each cmd
	#beq	$t9, $zero, no_debug

	#li	$v0, PRINT_INT
	#lw	$a0, BOT_X
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, ','
	#syscall
	#li	$v0, PRINT_INT
	#lw	$a0, BOT_Y
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, '\n'
	#syscall

no_debug:
	blt	$t1, 1000, execute_angle	# branches to appropriate instruction handler
	blt	$t1, 2000, execute_velocity	# depending on range of instruction (think of it like a weird
	beq	$t1, 2000, execute_udp		# opcode that works with integer ranges instead of bits)
	blt	$t1, 10000000, execute_hostcheck
	beq	$t1, 20000000, return_end
	blt	$t1, 100000000, execute_jump
	j	return_delay

# INSTRUCTION
execute_angle:					# set angle
	lw	$t9, is_blue_bot		# orientation matters
	beq	$t9, $zero, angle_write		# don't add 180 if starting top-left (red bot)

	add	$t1, $t1, 180			# fall-through to adding 180 for starting bottom-right (blue bot)
						# (angle comes direct from cmd parameter since no opcode offset)

angle_write:
	sw	$t1, ANGLE
	li	$t2, 1
	sw	$t2, ANGLE_CONTROL		# 1 = "absolute" angle control and store confirms and sets angle
	j	execute_until_delay

# INSTRUCTION
execute_velocity:				# set velocity
	sub	$t2, $t1, 1500			# subtract opcode offset
	sw	$t2, VELOCITY
	j	execute_until_delay

# INSTRUCTION
execute_udp:					# fire certain number of udp rounds (as set by hostcheck)
	lw	$t9, fire_udp_rounds

	#li	$v0, PRINT_INT
	#lw	$a0, ANGLE
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, ','
	#syscall
	#li	$v0, PRINT_INT
	#lw	$a0, BOT_X
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, ','
	#syscall
	#li	$v0, PRINT_INT
	#lw	$a0, BOT_Y
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, ','
	#syscall
	#li	$v0, PRINT_INT
	#move	$a0, $t9
	#syscall
	#li	$v0, PRINT_CHAR
	#li	$a0, '\n'
	#syscall

udp_fire:
	beq	$t9, $zero, udp_done
	sw	$zero, SHOOT_UDP_PACKET
	sub	$t9, $t9, 1
	j	udp_fire

udp_done:
	sw	$zero, fire_udp_rounds

	j	execute_until_delay

# INSTRUCTION
execute_hostcheck:				# hostcheck sets appropriate # of UDP
	la	$t5, arena_map			# packets to fire at the host at given (x, y)
	sw	$t5, ARENA_MAP

	sub	$t2, $t1, 3000			# command offset
	srl	$t3, $t2, 6			# x-tile (NOT pixel!)
	and	$t4, $t2, 0x3f			# y-tile (NOT pixel!)

	lw	$t9, is_blue_bot		# orientation matters
	beq	$t9, $zero, hostcheck_loadtile	# don't change tile if red bot

	sub	$t3, $t3, 39			# fall-through to flipping tile across y = x
	sub	$t4, $t4, 39			# (i.e. x = 39 - x; y = 39 - y)
	abs	$t3, $t3
	abs	$t4, $t4

hostcheck_loadtile:
	mul	$t4, $t4, 40			# map[y][x] == map[y * 40 + x]
	add	$t3, $t3, $t4			# index at $t3

	li	$t9, 0				# number of shots to fire

	lb	$t6, arena_map($t3)		# load tile type

	and	$t7, $t6, 4			# check friendly host
	bne	$t7, $zero, hostcheck_add_0	# branch if friendly host

	and	$t8, $t6, 8			# check enemy host
	beq	$t8, $zero, hostcheck_add_1	# branch if neutral host

	# enemy host: fall-through to 2 total shots

	add	$t9, $t9, 1			# 2 total shots if enemy

hostcheck_add_1:
	add	$t9, $t9, 1			# 1 total shot if neutral

hostcheck_add_0:
	sw	$t9, fire_udp_rounds		# 0 shots if friendly
	j	execute_until_delay

# INSTRUCTION
execute_jump:					# unconditional jump to offset in instruction
	sub	$t0, $t1, 10000000		# subtract "opcode"
	j	execute_until_delay

# INSTRUCTION
return_delay:					# sets up a delay and returns control to user
	sub	$t1, $t1, 100000000		# subtract "opcode"
	lw	$t2, TIMER
	add	$t2, $t2, $t1			# add delay (in cycles) to current cycle count
	sw	$t2, TIMER			# request interrupt

	# fall-through to storing current instruction and returning control

# INSTRUCTION
return_end:
	sw	$t0, current_move
	j	interrupt_dispatch		# see if other interrupts are waiting

request_puzzle_interrupt:
	sw	$0, REQUEST_PUZZLE_ACK

	# Write true to M[has_puzzle]
	la	$t0, has_puzzle
	li	$t1, 1
	sw	$t1, ($t0)

	j	interrupt_dispatch

respawn_interrupt:
	# Need to stop timer loop before acknowledging respawn to stop any
	# pending timer loop
	sw	$zero, TIMER_ACK

	# Acknowledge respawn. This puts the bot back into play
	sw	$0, RESPAWN_ACK

	lw	$t8, BOT_X			# get current location
	lw	$t9, BOT_Y			# more details on host mapping in scripts/host_mapping.md

	srl	$t8, $t8, 3			# convert pixels to tiles (divide by 8)
	srl	$t9, $t9, 3

	li	$t0, 0				# bitstring for pointer array index. Bits "3210", 0 is LSB

	li	$t6, 8				# what x will be compared to for bit 3
	li	$t7, 8				# what y will be compared to for bit 2

respawn_bit_3_x:
	blt	$t8, 16, respawn_bit_2_y
	or	$t0, $t0, 8			# set bit 3
	li	$t6, 32

respawn_bit_2_y:
	blt	$t9, 16, respawn_bit_1_0
	or	$t0, $t0, 4			# set bit 2
	li	$t7, 32

respawn_bit_1_0:
	sge	$t1, $t8, $t6			# $t1 is 0 if x < [8/32], else 1
	sge	$t2, $t9, $t7			# $t2 is 0 if y < [8/32], else 1

	sll	$t1, $t1, 1			# make $t1 into bit 1

	or	$t0, $t0, $t1			# set bit 1
	or	$t0, $t0, $t2			# set bit 0

	# convert number to offset for the int array (respawn pointers)
	sll	$t0, $t0, 2			# multiply by 4

	lw	$t5, respawn_pointers($t0)	# load in instruction to start at

	sw	$t5, current_move		# set instruction counter
	sw	$zero, TIMER			# request timer interrupt immediately so timer loop takes over

	j	interrupt_dispatch

non_intrpt:					# was some non-interrupt
	li	$v0, PRINT_STRING
	la	$a0, non_intrpt_str
	syscall					# print out an error message
						# fall through to done
done:
	la	$k0, chunkIH

	# Restore coprocessor1 registers!
	# If you don't do this and you decide to use division or multiplication
	#   in your main code, and interrupt handler code, you get WEIRD bugs.
	lw	$t0, 48($k0)
	mthi	$t0
	lw	$t0, 52($k0)
	mtlo	$t0

	lw	$a0, 0($k0)			# Restore saved registers
	lw	$v0, 4($k0)
	lw	$t0, 8($k0)
	lw	$t1, 12($k0)
	lw	$t2, 16($k0)
	lw	$t3, 20($k0)
	lw	$t4, 24($k0)
	lw	$t5, 28($k0)
	lw	$t6, 32($k0)
	lw	$t7, 36($k0)
	lw	$t8, 40($k0)
	lw	$t9, 44($k0)

.set noat
	move	$at, $k1		# Restore $at
.set at
	eret


