.text

.globl toggle_light
toggle_light:
    ## Variables corresponding to registers:

    ##
    ##	  $t6 = tmp_var
    ##	  $t5 = array_index
    ##	  $t3 = board
    ##	  $t4 = cond_var
    ##	  $t2 = num_colors
    ##	  $t1 = num_cols
    ##	  $t0 = num_rows
    ##	  $a3 = action_num
    ##	  $a2 = puzzle
    ##	  $a1 = col
    ##	  $a0 = row
    ##
	## End aliases



	# assign  $t0	= *0($a2)
	lw	$t0, 0($a2)
	# assign  $t1	= *4($a2)
	lw	$t1, 4($a2)
	# assign  $t2 = *8($a2)
	lw	$t2, 8($a2)
	# assign  $t3	= 12($a2)
	add	 $t3, $a2, 12

	# assign  $t5 = $t3&[$a0 * $t1 + $a1]
	mul	$t5, $a0, $t1
	add	$t5, $t5, $a1
	add	$t5, $t5, $t3
	# assign  $t6 = (*::($t5) + $a3) % $t2
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a3
	div	$t6, $t2
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

toggle_light_row_greater_if:
	ble	$a0, $0, toggle_light_col_greater_if

	# assign  $t5 = $t3&[($a0 - 1) * $t1 + $a1]
	addi	$t5, $a0, -1
	mul	$t5, $t5, $t1
	add	$t5, $t5, $a1
	add	$t5, $t5, $t3
	# assign  $t6 = (*::($t5) + $a3) % $t2
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a3
	div	$t6, $t2
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

toggle_light_col_greater_if:
	ble	$a1, $0, toggle_light_row_less_if

	# assign  $t5 = $t3&[($a0) * $t1 + $a1 - 1]
	mul	$t9, $a0, $t1
	add	$t9, $t9, $a1
	addi	$t5, $t9, -1
	add	$t5, $t5, $t3
	# assign  $t6 = (*::($t5) + $a3) % $t2
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a3
	div	$t6, $t2
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

toggle_light_row_less_if:
	# assign  $t4 = $t0 - 1
	addi	$t4, $t0, -1
	bge	$a0, $t4, toggle_light_col_less_if

	# assign  $t5 = $t3&[($a0 + 1) * $t1 + $a1]
	addi	$t5, $a0, 1
	mul	$t5, $t5, $t1
	add	$t5, $t5, $a1
	add	$t5, $t5, $t3
	# assign  $t6 = (*::($t5) + $a3) % $t2
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a3
	div	$t6, $t2
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

toggle_light_col_less_if:
	# assign  $t4 = $t1 - 1
	addi	$t4, $t1, -1
	bge	$a1, $t4, toggle_light_end

	# assign  $t5 = $t3&[($a0) * $t1 + $a1 + 1]
	mul	$t5, $a0, $t1
	add	$t5, $t5, $a1
	addi	$t5, $t5, 1
	add	$t5, $t5, $t3
	# assign  $t6 = (*::($t5) + $a3) % $t2
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a3
	div	$t6, $t2
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

toggle_light_end:
	jr	$ra


