.globl solve
solve:
    ## Stack setup
    ##
    ## Index 4	Variable puzzle
    ## Index 0	Variable ra
	addi	$sp, $sp, -40
	sw	$ra, 0($sp)
	sw	$a0, 4($sp)
	sw	$s0, 8($sp) 
	sw	$s1, 12($sp)
	sw	$s2, 16($sp)
	sw	$s3, 20($sp)
	sw	$s4, 24($sp)
	sw	$s5, 28($sp)
	sw	$s6, 32($sp)
	sw	$s7, 36($sp)
    ##
    ## End stack setup block

    ## Variables corresponding to registers:

    ##
    ##	  $t0 = tmp_var
    ##	  $s4 = actions
    ##	  $s3 = next_row
    ##	  $s2 = num_colors
    ##	  $s1 = num_cols
    ##	  $s0 = num_rows
    ##	  $s6 = col
    ##	  $s5 = row
    ##	  $a3 = col_in
    ##	  $a2 = row_in
    ##	  $s7 = solution
    ##	  $a1 = solution_in
    ##	  $a0 = puzzle
    ##
    ## End aliases



    # .stackalloc (4)solution
	# .stackalloc (4)row (4)col


	move	$s7, $a1
	move	$s5, $a2
	move	$s6, $a3

	# assign  $s0	= *0($a0)
	lw	$s0, 0($a0)
	# assign  $s1	= *4($a0)
	lw	$s1, 4($a0)
	# assign  $s2 = *8($a0)
	lw	$s2, 8($a0)


solve_next_row_ternary:
	# assign  $t0 = $s1 - 1
	addi	$t0, $s1, -1
	bne	$s6, $t0, solve_next_row_ternary_else

	# assign  $s3 = $s5 + 1
	addi	$s3, $s5, 1
	j	solve_next_row_ternary_end
solve_next_row_ternary_else:
	# assign  $s3 = $s5
	move	$s3, $s5
solve_next_row_ternary_end:

solve_if_done:
	bge	$s5, $s0, solve_if_done_cond
	bge	$s6, $s1, solve_if_done_cond
	j	solve_if_done_skip
solve_if_done_cond:
	# return board_done(num_rows,num_cols,puzzle->board);
	move	$a0, $s0
	move	$a1, $s1
	# assign  $a2 = *12($a0)
	lw	$a2, 4($sp)
	add	$a2,$a2,12

	jal	solver_board_done

    ## Stack frame teardown block
    ##
	lw	$ra, 0($sp)
	lw	$s0, 8($sp) 
	lw	$s1, 12($sp)
	lw	$s2, 16($sp)
	lw	$s3, 20($sp)
	lw	$s4, 24($sp)
	lw	$s5, 28($sp)
	lw	$s6, 32($sp)
	lw	$s7, 36($sp)
	addi	$sp, $sp, 40
    ##
    ## End stack teardown

	jr	$ra

